import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import FileUpload from './FileUpload';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <h1>best app ever</h1>
      <p>{!data ? "Loading..." : data}</p>
      <FileUpload />
    </div>
  );
}

export default App;
